			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "##########################################\n#\n# c.f. http://stackoverflow.com/questions/3520977/build-fat-static-library-device-simulator-using-xcode-and-sdk-4\n#\n# Version 2.7\n#\n# Latest Change:\n# - Supports iPhone 5 / iPod Touch 5 (uses Apple's workaround to lipo bug)\n#\n# Purpose:\n#   Automatically create a Universal static library for iPhone + iPad + iPhone Simulator from within XCode\n#\n# Author: Adam Martin - http://twitter.com/redglassesapps\n# Based on: original script from Eonil (main changes: Eonil's script WILL NOT WORK in Xcode GUI - it WILL CRASH YOUR COMPUTER)\n#\n\nset -e\nset -o pipefail\n\n#################[ Tests: helps workaround any future bugs in Xcode ]########\n#\nDEBUG_THIS_SCRIPT=\"false\"\n\nif [ $DEBUG_THIS_SCRIPT = \"true\" ]\nthen\n    echo \"########### TESTS #############\"\n    echo \"Use the following variables when debugging this script; note that they may change on recursions\"\n    echo \"BUILD_DIR = $BUILD_DIR\"\n    echo \"BUILD_ROOT = $BUILD_ROOT\"\n    echo \"CONFIGURATION_BUILD_DIR = $CONFIGURATION_BUILD_DIR\"\n    echo \"BUILT_PRODUCTS_DIR = $BUILT_PRODUCTS_DIR\"\n    echo \"CONFIGURATION_TEMP_DIR = $CONFIGURATION_TEMP_DIR\"\n    echo \"TARGET_BUILD_DIR = $TARGET_BUILD_DIR\"\nfi\n\n#####################[ part 1 ]##################\n# First, work out the BASESDK version number (NB: Apple ought to report this, but they hide it)\n#    (incidental: searching for substrings in sh is a nightmare! Sob)\n\nSDK_VERSION=$(echo ${SDK_NAME} | grep -o '.\\{3\\}$')\n\n# Next, work out if we're in SIM or DEVICE\n\nif [ ${PLATFORM_NAME} = \"iphonesimulator\" ]\nthen\n    OTHER_SDK_TO_BUILD=iphoneos${SDK_VERSION}\nelse\n    OTHER_SDK_TO_BUILD=iphonesimulator${SDK_VERSION}\nfi\n\necho \"XCode has selected SDK: ${PLATFORM_NAME} with version: ${SDK_VERSION} (although back-targetting: ${IPHONEOS_DEPLOYMENT_TARGET})\"\necho \"...therefore, OTHER_SDK_TO_BUILD = ${OTHER_SDK_TO_BUILD}\"\n#\n#####################[ end of part 1 ]##################\n\n#####################[ part 2 ]##################\n#\n# IF this is the original invocation, invoke WHATEVER other builds are required\n#\n# Xcode is already building ONE target...\n#\n# ...but this is a LIBRARY, so Apple is wrong to set it to build just one.\n# ...we need to build ALL targets\n# ...we MUST NOT re-build the target that is ALREADY being built: Xcode WILL CRASH YOUR COMPUTER if you try this (infinite recursion!)\n#\n#\n# So: build ONLY the missing platforms/configurations.\n\nif [ \"true\" == ${ALREADYINVOKED:-false} ]\nthen\n    echo \"RECURSION: I am NOT the root invocation, so I'm NOT going to recurse\"\nelse\n    # CRITICAL:\n    # Prevent infinite recursion (Xcode sucks)\n    export ALREADYINVOKED=\"true\"\n\n    echo \"RECURSION: I am the root ... recursing all missing build targets NOW...\"\n    echo \"RECURSION: ...about to invoke: xcodebuild -configuration \\\"${CONFIGURATION}\\\" -project \\\"${PROJECT_NAME}.xcodeproj\\\" -target \\\"${TARGET_NAME}\\\" -sdk \\\"${OTHER_SDK_TO_BUILD}\\\" ${ACTION} RUN_CLANG_STATIC_ANALYZER=NO\" BUILD_DIR=\\\"${BUILD_DIR}\\\" BUILD_ROOT=\\\"${BUILD_ROOT}\\\" SYMROOT=\\\"${SYMROOT}\\\"\n\n    xcodebuild -configuration \"${CONFIGURATION}\" -project \"${PROJECT_NAME}.xcodeproj\" -target \"${TARGET_NAME}\" -sdk \"${OTHER_SDK_TO_BUILD}\" ${ACTION} RUN_CLANG_STATIC_ANALYZER=NO BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\"\n\n    ACTION=\"build\"\n\n    #Merge all platform binaries as a fat binary for each configurations.\n\n    # Calculate where the (multiple) built files are coming from:\n    CURRENTCONFIG_DEVICE_DIR=${SYMROOT}/${CONFIGURATION}-iphoneos\n    CURRENTCONFIG_SIMULATOR_DIR=${SYMROOT}/${CONFIGURATION}-iphonesimulator\n\n    echo \"Taking device build from: ${CURRENTCONFIG_DEVICE_DIR}\"\n    echo \"Taking simulator build from: ${CURRENTCONFIG_SIMULATOR_DIR}\"\n\n    CREATING_UNIVERSAL_DIR=${SYMROOT}/${CONFIGURATION}-universal\n    echo \"...I will output a universal build to: ${CREATING_UNIVERSAL_DIR}\"\n\n    # ... remove the products of previous runs of this script\n    #      NB: this directory is ONLY created by this script - it should be safe to delete!\n\n    rm -rf \"${CREATING_UNIVERSAL_DIR}\"\n    mkdir \"${CREATING_UNIVERSAL_DIR}\"\n\n    #\n    echo \"lipo: for current configuration (${CONFIGURATION}) creating output file: ${CREATING_UNIVERSAL_DIR}/${EXECUTABLE_NAME}\"\n    xcrun -sdk iphoneos lipo -create -output \"${CREATING_UNIVERSAL_DIR}/${EXECUTABLE_NAME}\" \"${CURRENTCONFIG_DEVICE_DIR}/${EXECUTABLE_NAME}\" \"${CURRENTCONFIG_SIMULATOR_DIR}/${EXECUTABLE_NAME}\"\n\n    #\n    # strip the library of debugging symbols\n    #\n    echo \"stripping ${EXECUTABLE_NAME}\"\n    strip -S \"${CREATING_UNIVERSAL_DIR}/${EXECUTABLE_NAME}\"\n\n    #########\n    #\n    # Added: StackOverflow suggestion to also copy \"include\" files\n    #    (untested, but should work OK)\n    #\n    echo \"Fetching headers from ${PUBLIC_HEADERS_FOLDER_PATH}\"\n    echo \"  (if you embed your library project in another project, you will need to add\"\n    echo \"   a \"User Search Headers\" build setting of: (NB INCLUDE THE DOUBLE QUOTES BELOW!)\"\n    echo '        \"$(TARGET_BUILD_DIR)/usr/local/include/\"'\n    \n    if [ -d \"${CURRENTCONFIG_DEVICE_DIR}${PUBLIC_HEADERS_FOLDER_PATH}\" ]\n    then\n        mkdir -p \"${CREATING_UNIVERSAL_DIR}${PUBLIC_HEADERS_FOLDER_PATH}\"\n        # * needs to be outside the double quotes?\n    cp -r \"${CURRENTCONFIG_DEVICE_DIR}${PUBLIC_HEADERS_FOLDER_PATH}\"* \"${CREATING_UNIVERSAL_DIR}${PUBLIC_HEADERS_FOLDER_PATH}\"\n  fi\n\n  #open \"${CREATING_UNIVERSAL_DIR}\"\n  # copy to sample app for testing\n  echo \"Copying static binary to for sample app ${CREATING_UNIVERSAL_DIR}/${EXECUTABLE_NAME}\"\n    cp \"${CREATING_UNIVERSAL_DIR}/${EXECUTABLE_NAME}\" ../sample/\n\nfi\n\n";
			showEnvVarsInLog = 0;
		};
